import './App.css';
import NavBar from './components/NavBar';

import React, { Component } from 'react'
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <NavBar />
          <h2>Top News</h2>
          <Switch>
          <Route path="/Business"><News cat='business' country='in' /></Route>
          <Route path="/Entertainment"><News cat='entertainment' country='in' /></Route>
          <Route path="/"><News cat='general' country='in' /></Route>
          <Route path="/General"><News cat='general' country='in' /></Route>
          <Route path="/Health"><News cat='health' country='in' /></Route>
          <Route path="/Sports"><News cat='sports' country='in' /></Route>
          <Route path="/Science"><News cat='science' country='in' /></Route>
          <Route path="/Technology"><News cat='technology' country='in' /></Route>
        </Switch>
        </Router>
      </div>
    )
  }
}
